import React from 'react';
import './css/App.css';
import Main from './views/Main';
import ParticlesBg from 'particles-bg'


function App() {


  return (
    <div className="container">
      <ParticlesBg color="#ff0000" num={100} type="cobweb" bg={true} />
      <div style={{background:"white", marginRight:''}}>
        <Main />
      </div>
    </div>
  );
}

export default App;
